export default {
  mounted() {
    this.drawBodyModel();

    // Add click event listener to canvas element
    const canvas = this.$refs.canvas;
    canvas.addEventListener("click", this.onCanvasClick);
  },
  methods: {
    drawBodyModel() {
      const canvas = this.$refs.canvas;
      const ctx = canvas.getContext("2d");

      // Draw the head
      ctx.fillStyle = "#FFE0BD";
      ctx.beginPath();
      ctx.arc(200, 100, 50, 0, 2 * Math.PI);
      ctx.fill();

      // Draw the neck
      ctx.fillRect(200 - 10, 150, 20, 30);

      // Draw the torso
      ctx.fillStyle = "#FFE0BD";
      ctx.fillRect(100, 180, 200, 200);

      // Draw the left arm
      ctx.beginPath();
      ctx.moveTo(100, 200);
      ctx.lineTo(70, 240);
      ctx.lineTo(70, 300);
      ctx.lineTo(100, 280);
      ctx.closePath();
      ctx.fill();
      ctx.fillRect(70, 240, 10, 60);

      // Draw the right arm
      ctx.beginPath();
      ctx.moveTo(300, 200);
      ctx.lineTo(330, 240);
      ctx.lineTo(330, 300);
      ctx.lineTo(300, 280);
      ctx.closePath();
      ctx.fill();
      ctx.fillRect(330, 240, 10, 60);

      // Draw the left hand
      ctx.fillStyle = "#FFE0BD";
      ctx.fillRect(55, 300, 30, 15);
      ctx.fillRect(50, 305, 5, 10);

      // Draw the right hand
      ctx.fillRect(315, 300, 30, 15);
      ctx.fillRect(340, 305, 5, 10);

      // Draw the left leg
      ctx.beginPath();
      ctx.moveTo(150, 380);
      ctx.lineTo(150, 500);
      ctx.lineTo(110, 500);
      ctx.lineTo(110, 530);
      ctx.lineTo(150, 530);
      ctx.lineTo(150, 550);
      ctx.lineTo(170, 550);
      ctx.lineTo(170, 530);
      ctx.lineTo(210, 530);
      ctx.lineTo(210, 500);
      ctx.lineTo(170, 500);
      ctx.lineTo(170, 380);
      ctx.closePath();
      ctx.fill();

      // Draw the right leg
      ctx.beginPath();
      ctx.moveTo(250, 380);
      ctx.lineTo(250, 500);
      ctx.lineTo(290, 500);
      ctx.lineTo(290, 530);
      ctx.lineTo(250, 530);
      ctx.lineTo(250, 550);
      ctx.lineTo(230, 550);
      ctx.lineTo(230, 530);
      ctx.lineTo(190, 530);
      ctx.lineTo(190, 500);
      ctx.lineTo(230, 500);
      ctx.lineTo(230, 380);
      ctx.closePath();
      ctx.fill();

      // Draw the left foot
      ctx.fillStyle = "#6B441F";
      ctx.fillRect(95, 550, 35, 20);
      ctx.fillRect(100, 570, 10, 5);
      ctx.fillRect(120, 570, 10, 5);

      // Draw the right foot
      ctx.fillRect(265, 550, 35, 20);
      ctx.fillRect(270, 570, 10, 5);
      ctx.fillRect(290, 570, 10, 5);

      // Set the clickable areas of the body parts
      this.headArea = {
        x: 150,
        y: 50,
        width: 100,
        height: 100,
        label: "Head"
      };
      this.torsoArea = {
        x: 100,
        y: 180,
        width: 200,
        height: 200,
        label: "Torso"
      };
      this.leftArmArea = {
        x: 70,
        y: 240,
        width: 80,
        height: 60,
        label: "Left Arm"
      };
      this.rightArmArea = {
        x: 250,
        y: 240,
        width: 80,
        height: 60,
        label: "Right Arm"
      };
      this.leftHandArea = {
        x: 50,
        y: 300,
        width: 35,
        height: 15,
        label: "Left Hand"
      };
      this.rightHandArea = {
        x: 315,
        y: 300,
        width: 35,
        height: 15,
        label: "Right Hand"
      };
      this.leftLegArea = {
        x: 110,
        y: 380,
        width: 100,
        height: 170,
        label: "Left Leg"
      };
      this.rightLegArea = {
        x: 190,
        y: 380,
        width: 100,
        height: 170,
        label: "Right Leg"
      };
    },
    onCanvasClick(event) {
      const rect = event.target.getBoundingClientRect();
      const x = event.clientX - rect.left;
      const y = event.clientY - rect.top;

      // Check if clicked on any of the body parts
      const clickedAreas = [this.headArea, this.torsoArea, this.leftArmArea, this.rightArmArea, this.leftHandArea, this.rightHandArea, this.leftLegArea, this.rightLegArea];
      const clickedArea = clickedAreas.find(area => {
        return x > area.x && x < area.x + area.width && y > area.y && y < area.y + area.height;
      });

      // Show label of clicked body part
      if (clickedArea) {
        alert(`Clicked on ${clickedArea.label}`);
      }
    }
  },
  data() {
    return {
      headArea: {},
      torsoArea: {},
      leftArmArea: {},
      rightArmArea: {},
      leftHandArea: {},
      rightHandArea: {},
      leftLegArea: {},
      rightLegArea: {}
    };
  }
};
